  const[age,setAge]=useState(0); 

  const[country,setCountry]=useState(""); 

  const[position,setPosition]=useState(""); 

  const[salary,setSalary]=useState(0); 


const addEmployee=()=>{



  Axios.post('http://localhost:3001/create',
  {
 name:name,
 age:age,
 country:country,
 position:position,
 salary:salary,

}).then(()=>{
  console.log("success");
})

};

